import logo from './logo.svg';
import { Component } from 'react';
import './App.css';


class App extends Component{

 constructor(){
   super();

   this.state={
     monster1: {
       name: 'Linda'
     },
     monster2: {
      name: 'Bally'
    },
    monster3: {
      name: 'Karen'
    },
   }

 }

  render(){
    return (
      <div className="App">
        <h1>{this.state.monster1.name}</h1>
        <h1>{this.state.monster2.name}</h1>
        <h1>{this.state.monster3.name}</h1>
      </div>
    );
  }

}

export default App;
